/**
 * User message component
 * Right-aligned with blue bubble design
 */

import type { ChatMessage, TextBlock, ToolResultBlock } from '../../shared/types/chat';

interface UserMessageProps {
  message: ChatMessage;
}

export function UserMessage({ message }: UserMessageProps) {
  // Extract text content from content blocks
  const textBlocks = message.content.filter(
    (block): block is TextBlock => block.type === 'text'
  );

  // Extract tool result blocks
  const toolResultBlocks = message.content.filter(
    (block): block is ToolResultBlock => block.type === 'tool_result'
  );

  // If message only contains tool results (no text), don't render
  // Tool results are already shown inline with the assistant's tool_use blocks
  const hasText = textBlocks.length > 0;
  const hasToolResults = toolResultBlocks.length > 0;

  // Hide messages that only contain tool results (API plumbing, already shown in assistant message)
  if (!hasText && hasToolResults) {
    return null;
  }

  return (
    <div className="flex justify-end mb-4">
      <div className="max-w-[80%]">
        {/* Text content */}
        {hasText && (
          <div className="rounded-lg bg-primary text-primary-foreground px-4 py-3 shadow-sm">
            <div className="whitespace-pre-wrap break-words text-sm">
              {textBlocks.map((block: TextBlock) => block.text).join('\n\n')}
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

/**
 * Assistant message component
 * Left-aligned with AI avatar
 */

import { AlertCircle } from 'lucide-react';
import type { ChatMessage } from '../../shared/types/chat';
import { ContentBlockRenderer } from './ContentBlockRenderer';
import { TextBlock } from './TextBlock';

interface AssistantMessageProps {
  message: ChatMessage;
  toolResults?: Map<string, { content: string; is_error?: boolean }>;
}

export function AssistantMessage({ message, toolResults }: AssistantMessageProps) {
  const content = message.content;

  // Strip ANSI color codes from text
  const stripAnsiCodes = (text: string): string => {
    // eslint-disable-next-line no-control-regex
    return text.replace(/\x1b\[[0-9;]*m/g, '');
  };

  // Check if this is an error message - render with special styling
  if (message.isError) {
    // Extract text from content blocks
    const errorText = content
      .filter((block: any) => block.type === 'text')
      .map((block: any) => stripAnsiCodes(block.text))
      .join('\n');

    return (
      <div className="flex justify-center w-full">
        <div className="w-full max-w-4xl">
          <div className="rounded-lg border border-red-200 bg-red-50 dark:border-red-900 dark:bg-red-950/20 p-4">
            <div className="flex items-start gap-3">
              <AlertCircle className="h-5 w-5 text-red-600 dark:text-red-400 flex-shrink-0 mt-0.5" />
              <div className="flex-1 min-w-0">
                <div className="text-sm font-medium text-red-900 dark:text-red-100 mb-2">
                  Error from Server
                </div>
                <div className="text-sm text-red-800 dark:text-red-200">
                  <div className="whitespace-pre-wrap break-words">
                    {errorText}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }

  // Render content blocks with proper formatting
  return (
    <div className="w-full">
      {/* Content blocks */}
      <div className="space-y-4">
        {content.map((block, index) => (
          <ContentBlockRenderer
            key={index}
            block={block}
            toolResults={toolResults}
          />
        ))}
      </div>
    </div>
  );
}

/**
 * Text content block with Markdown rendering
 */

import ReactMarkdown from "react-markdown";
import remarkGfm from "remark-gfm";

interface TextBlockProps {
  text: string;
  className?: string;
}

export function TextBlock({ text, className = "" }: TextBlockProps) {
  return (
    <div
      className={`prose dark:prose-invert max-w-none prose-hr:my-2 ${className}`}
    >
      <ReactMarkdown
        remarkPlugins={[remarkGfm]}
        components={{
          // Custom heading renderers - compact and minimal
          h1({ children, ...props }) {
            return (
              <h1 className="text-lg font-semibold mb-2 mt-3" {...props}>
                {children}
              </h1>
            );
          },
          h2({ children, ...props }) {
            return (
              <h2 className="text-base font-semibold mb-1.5 mt-3" {...props}>
                {children}
              </h2>
            );
          },
          h3({ children, ...props }) {
            return (
              <h3 className="text-sm font-semibold mb-1 mt-2" {...props}>
                {children}
              </h3>
            );
          },
          h4({ children, ...props }) {
            return (
              <h4 className="text-sm font-medium mb-1 mt-2" {...props}>
                {children}
              </h4>
            );
          },
          h5({ children, ...props }) {
            return (
              <h5 className="text-sm font-medium mb-1 mt-2" {...props}>
                {children}
              </h5>
            );
          },
          h6({ children, ...props }) {
            return (
              <h6 className="text-sm font-medium mb-1 mt-2" {...props}>
                {children}
              </h6>
            );
          },
          // Custom code inline rendering
          code({ className, children, ...props }) {
            const match = /language-(\w+)/.exec(className || "");
            const isInline = !match;

            if (isInline) {
              return (
                <code
                  className="px-1.5 py-0.5 rounded bg-muted text-blue-700 font-mono text-sm font-normal"
                  {...props}
                >
                  {children}
                </code>
              );
            }

            // Block code will be handled by parent component or CodeBlock
            return (
              <code className={className} {...props}>
                {children}
              </code>
            );
          },
          // Custom link rendering
          a({ href, children, ...props }) {
            return (
              <a
                href={href}
                target="_blank"
                rel="noopener noreferrer"
                className="text-primary hover:underline"
                {...props}
              >
                {children}
              </a>
            );
          },
          // Custom blockquote rendering
          blockquote({ children, ...props }) {
            return (
              <blockquote
                className="border-l-4 border-muted-foreground/20 pl-4 italic text-muted-foreground"
                {...props}
              >
                {children}
              </blockquote>
            );
          },
        }}
      >
        {text}
      </ReactMarkdown>
    </div>
  );
}

